<details>
<summary>Release Notes for 9.5 ‚ÄúDraco dormiens nunquam titillandus‚Äù</summary>

<p><a target="_blank" rel="noopener noreferrer" href="https://user-images.githubusercontent.com/19343/54381375-f81f0580-4663-11e9-9113-7098a1463f76.png"><img src="https://user-images.githubusercontent.com/19343/54381375-f81f0580-4663-11e9-9113-7098a1463f76.png" alt="Coat of Arms of Hogwarts" width="200" height="279" align="right" style="max-width:100%;"></a></p>
<p>Autoprefixer 9.5 brings <code>mask-composite</code> support.</p>
<div class="highlight highlight-source-css"><pre><span class="pl-ent">a</span> {
  <span class="pl-c1"><span class="pl-c1">mask-composite</span></span>: <span class="pl-c1">add</span>;
}
<span class="pl-ent">b</span> {
  <span class="pl-c1"><span class="pl-c1">mask</span></span>: <span class="pl-c1">url</span>(<span class="pl-v">intersect.png</span>) <span class="pl-c1">intersect</span>, <span class="pl-c1">url</span>(<span class="pl-v">exclude.png</span>);
}</pre></div>
<div class="highlight highlight-source-css"><pre><span class="pl-ent">a</span> {
  <span class="pl-c1"><span class="pl-c1">-webkit-mask-composite</span></span>: source-over;
          <span class="pl-c1"><span class="pl-c1">mask-composite</span></span>: <span class="pl-c1">add</span>;
}
<span class="pl-ent">b</span> {
  <span class="pl-c1"><span class="pl-c1">-webkit-mask</span></span>: <span class="pl-c1">url</span>(<span class="pl-v">intersect.png</span>), <span class="pl-c1">url</span>(<span class="pl-v">exclude.png</span>);
  <span class="pl-c1"><span class="pl-c1">-webkit-mask-composite</span></span>: source-in, xor;
          <span class="pl-c1"><span class="pl-c1">mask</span></span>: <span class="pl-c1">url</span>(<span class="pl-v">intersect.png</span>) <span class="pl-c1">intersect</span>, <span class="pl-c1">url</span>(<span class="pl-v">exclude.png</span>);
}</pre></div>
<p>Thanks to <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=5983693" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/semeleven">@semeleven</a> for implementation and <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=1260529" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/iamvdo">@iamvdo</a> for suggestion.</p>
</details>



