<details>
<summary>Release Notes for 9.4 ‚ÄúAdvance Australia‚Äù</summary>

<p><a target="_blank" rel="noopener noreferrer" href="https://user-images.githubusercontent.com/19343/49359288-7d1f8800-f721-11e8-8b7f-27fd56049d34.png"><img src="https://user-images.githubusercontent.com/19343/49359288-7d1f8800-f721-11e8-8b7f-27fd56049d34.png" alt="Coat of Arms of Australia" width="235" height="182" align="right" style="max-width:100%;"></a></p>
<p>Autoprefixer 9.4.0 brings limited <strong>autoplacement</strong> support to the IE CSS Grid.</p>
<h2>Grid Autoplacement</h2>
<p>If the <code>grid</code> option is set to <code>"autoplace"</code>, limited autoplacement support is now added to the Autoprefixer CSS Grid translations. You can also use the <code>/* autoprefixer grid: autoplace */</code> control comment to enable autoplacement directly in your CSS.</p>
<p>In order to use the new autoplacement feature, you <strong>must define both rows and columns</strong> when declaring the grid template.</p>
<div class="highlight highlight-source-css"><pre><span class="pl-c"><span class="pl-c">/*</span> Input CSS <span class="pl-c">*/</span></span>

<span class="pl-c"><span class="pl-c">/*</span> autoprefixer grid: autoplace <span class="pl-c">*/</span></span>

<span class="pl-e">.autoplacement-example</span> {
    <span class="pl-c1"><span class="pl-c1">display</span></span>: <span class="pl-c1">grid</span>;
    <span class="pl-c1"><span class="pl-c1">grid-template-columns</span></span>: <span class="pl-c1">1<span class="pl-k">fr</span></span> <span class="pl-c1">1<span class="pl-k">fr</span></span>;
    <span class="pl-c1"><span class="pl-c1">grid-template-rows</span></span>: <span class="pl-c1">auto</span> <span class="pl-c1">auto</span>;
    <span class="pl-c1"><span class="pl-c1">grid-gap</span></span>: <span class="pl-c1">20<span class="pl-k">px</span></span>;
}</pre></div>
<div class="highlight highlight-source-css"><pre><span class="pl-c"><span class="pl-c">/*</span> Output CSS <span class="pl-c">*/</span></span>

<span class="pl-c"><span class="pl-c">/*</span> autoprefixer grid: autoplace <span class="pl-c">*/</span></span>

<span class="pl-e">.autoplacement-example</span> {
  <span class="pl-c1"><span class="pl-c1">display</span></span>: <span class="pl-c1">-ms-grid</span>;
  <span class="pl-c1"><span class="pl-c1">display</span></span>: <span class="pl-c1">grid</span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-columns</span></span>: <span class="pl-c1">1<span class="pl-k">fr</span></span> <span class="pl-c1">20<span class="pl-k">px</span></span> <span class="pl-c1">1<span class="pl-k">fr</span></span>;
  <span class="pl-c1"><span class="pl-c1">grid-template-columns</span></span>: <span class="pl-c1">1<span class="pl-k">fr</span></span> <span class="pl-c1">1<span class="pl-k">fr</span></span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-rows</span></span>: <span class="pl-c1">auto</span> <span class="pl-c1">20<span class="pl-k">px</span></span> <span class="pl-c1">auto</span>;
  <span class="pl-c1"><span class="pl-c1">grid-template-rows</span></span>: <span class="pl-c1">auto</span> <span class="pl-c1">auto</span>;
  <span class="pl-c1"><span class="pl-c1">grid-gap</span></span>: <span class="pl-c1">20<span class="pl-k">px</span></span>;
}

<span class="pl-e">.autoplacement-example</span> <span class="pl-k">&gt;</span> <span class="pl-ent">*</span><span class="pl-e">:nth-child</span>(<span class="pl-c1">1</span>) {
  <span class="pl-c1"><span class="pl-c1">-ms-grid-row</span></span>: <span class="pl-c1">1</span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-column</span></span>: <span class="pl-c1">1</span>;
}

<span class="pl-e">.autoplacement-example</span> <span class="pl-k">&gt;</span> <span class="pl-ent">*</span><span class="pl-e">:nth-child</span>(<span class="pl-c1">2</span>) {
  <span class="pl-c1"><span class="pl-c1">-ms-grid-row</span></span>: <span class="pl-c1">1</span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-column</span></span>: <span class="pl-c1">3</span>;
}

<span class="pl-e">.autoplacement-example</span> <span class="pl-k">&gt;</span> <span class="pl-ent">*</span><span class="pl-e">:nth-child</span>(<span class="pl-c1">3</span>) {
  <span class="pl-c1"><span class="pl-c1">-ms-grid-row</span></span>: <span class="pl-c1">3</span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-column</span></span>: <span class="pl-c1">1</span>;
}

<span class="pl-e">.autoplacement-example</span> <span class="pl-k">&gt;</span> <span class="pl-ent">*</span><span class="pl-e">:nth-child</span>(<span class="pl-c1">4</span>) {
  <span class="pl-c1"><span class="pl-c1">-ms-grid-row</span></span>: <span class="pl-c1">3</span>;
  <span class="pl-c1"><span class="pl-c1">-ms-grid-column</span></span>: <span class="pl-c1">3</span>;
}</pre></div>
<p>Autoplacement support in Autoprefixer is currently very limited in what it can do. Please read the  <a href="https://urls.greenkeeper.io/postcss/autoprefixer#grid-autoplacement-support-in-ie">Grid Autoplacement support in IE </a> section before using this new feature.</p>
<p>Thanks to <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=7077307" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/bogdan0083">@bogdan0083</a> for implementing the new feature, <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=10610368" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/Dan503">@Dan503</a> for documenting it, and <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=13557274" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/evandiamond">@evandiamond</a> for coming up with the initial idea.</p>
<h2>Other Changes</h2>
<ul>
<li>Remove some unnecessary warnings for Grid (by <a class="user-mention" data-hovercard-type="user" data-hovercard-url="/hovercards?user_id=20732009" data-octo-click="hovercard-link-click" data-octo-dimensions="link_type:self" href="https://urls.greenkeeper.io/fanich37">@fanich37</a>).</li>
</ul>
</details>



